Boa noite galera, PS5 pode receber assistente de voz com tecnologia I.A chamado "PlayStation Assist".📸🎮😀
-
_
(Notícias)🗞⤵️
_

O PS5 parece uma peça impressionante de hardware, com base na lista de especificações reveladas pela Sony até agora, seja o CPU Zen 2, o SSD ou qualquer outra coisa, mas parece que a Sony tem outras idéias para o console também no qual eles ainda não falaram.
.
Por exemplo, como Daniel Ahmad, analista sênior da Niko Partners, apontou no Twitter, a Sony recentemente registrou uma nova patente para algo chamado "PlayStation Assist", que parece um conceito realmente interessante. É descrito como uma assistente de voz alimentado por inteligência artificial, para que o jogador possa fazer uma pergunta sobre algo no jogo (o exemplo que Ahmad usa é perguntar ao assistente onde está o pacote de saúde mais próximo do jogo), no qual a assistente insere sua consulta e responde dinamicamente a ela com informações relevantes. Isso não apenas é algo que pode funcionar muito bem em jogos de realidade virtual, mas também pode ser um grande impulso para as opções de acessibilidade.
.
Não há garantia de que isso veja a luz do dia, mas é ótimo ver que a Sony pelo menos está pensando e trabalhando em tais idéias. Esperamos ver mais disso no futuro próximo. Um relatório recente sugeriu que a Sony apresentaria o PS5 na íntegra em fevereiro de 2020, portanto, é possível que recebamos mais informações, se isso acontecer.
